// Section1.js
import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import axios from 'axios';
import { faChevronLeft, faChevronRight } from '@fortawesome/free-solid-svg-icons';
import items from '../data.js'; // ÏûÑÏùò Îç∞Ïù¥ÌÑ∞ ÌååÏùº import
import { useNavigate } from 'react-router-dom'; // useNavigate ÌõÖ import

//Í∞Å ÏÑπÏÖòÏùò Îç∞Ïù¥ÌÑ∞Î•º ÏÉÅÌÉúÎ°ú Í¥ÄÎ¶¨Ìï©ÎãàÎã§: useStateÎ•º ÏÇ¨Ïö©ÌïòÏó¨ Îç∞Ïù¥ÌÑ∞Î•º Ï†ÄÏû•ÌïòÍ≥†, 
//useEffectÎ•º ÌÜµÌï¥ Ïª¥Ìè¨ÎÑåÌä∏Í∞Ä ÎßàÏö¥Ìä∏Îê† Îïå Îç∞Ïù¥ÌÑ∞Î•º FetchÌï©ÎãàÎã§.

function Section1({ onProjectClick }) {
  const [popularProjects, setPopularProjects] = useState([]);
  //    [ ÌòÑÏû¨ ÏÉÅÌÉúÍ∞í, ÏÉÅÌÉú ÏóÖÎç∞Ïù¥Ìä∏ Ìï®Ïàò]
  const navigate = useNavigate(); // useNavigate ÌõÖÏùÑ ÏÇ¨Ïö©ÌïòÏó¨ navigate Ìï®Ïàò ÏÉùÏÑ±



  // const fetchPopularProjects = async () => {
  //   try {
  //     const response = await axios.get('/api/projects/popular'); // Ïù∏Í∏∞ ÌîÑÎ°úÏ†ùÌä∏ Îç∞Ïù¥ÌÑ∞ ÏöîÏ≤≠
  //     setPopularProjects(response.data);
  //   } catch (error) {
  //     console.error('Error fetching popular projects:', error);
  //   }
  // };

  const fetchPopularProjects = () => {
    //instead api use data.js (for practice)
    setPopularProjects(items)

  }

  // Ïä¨ÎùºÏù¥ÎìúÏùò IDÎ•º ÏÑ§Ï†ï
  const sliderId = 'itemSlider';

  //Îã®ÏàúÌôîÌïú ÏΩîÎìú
  // const fetchPopularProjects = async () => {
  //   const response = await axios.get('/api/projects/popular');
  //   setPopularProjects(response.data);
  // };
  useEffect(() => {
    fetchPopularProjects();
  }, []);


  const handleProjectClick = (project) => {
    // ÌÅ¥Î¶≠Îêú ÌîÑÎ°úÏ†ùÌä∏Ïùò IDÎ•º ÏÇ¨Ïö©ÌïòÏó¨ ÏÉÅÏÑ∏ ÌéòÏù¥ÏßÄÎ°ú Ïù¥Îèô
    // navigate(`/projects/${project.id}`); // Í≤ΩÎ°úÎäî ÌïÑÏöîÏóê Îî∞Îùº ÏàòÏ†ïÌïòÏÑ∏Ïöî
    navigate('/ApplyPage');
  };


  return (
    <SectionWrapper>
      <SectionTitle>Ïù∏Í∏∞ ÌîÑÎ°úÏ†ùÌä∏</SectionTitle>
      <ProjectList>
        {popularProjects.slice(0, 3).map((project, index) => (
          <ProjectCard key={index} onClick={() => handleProjectClick(project)}>
            <ProjectOwner>üë§{project.creatorid}</ProjectOwner>
            <ProjectLikes>
              <FontAwesomeIcon icon={faHeart} style={{ color: 'red' }} />
              {project.likescount}
            </ProjectLikes>
            <ProjectTitle>{project.title}</ProjectTitle>
            <ProjectInfo>
              <Tags>
                {project.tags.map((tag, tagIndex) => (
                  <Tag key={tagIndex}>{tag}</Tag>
                ))}
              </Tags>
              <Details>
                Î™®ÏßëÏù∏Ïõê: {project.recruitmentnum}Î™Ö | ÎßàÍ∞êÏùº: {new Date(project.deadline).toLocaleDateString()}
              </Details>
            </ProjectInfo>
          </ProjectCard>
        ))}
      </ProjectList>
    </SectionWrapper>
  );
}

// Ïä§ÌÉÄÏùº Ïª¥Ìè¨ÎÑåÌä∏ 

// Ïä§ÌÉÄÏùº Ïª¥Ìè¨ÎÑåÌä∏
const SectionWrapper = styled.div`
  width: calc(100% / 2 + 100px);
  border: 2px solid #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  gap: 20px;
  background-color: rgba(160, 218, 251, 0.5);
`;

const SectionTitle = styled.h2`
  font-size: 24px;
  margin-bottom: 20px;
`;

const ProjectList = styled.div`
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  gap: 20px;
`;

const ProjectCard = styled.div`
  position: relative;
  border: 2px solid #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  padding: 15px;
  margin-bottom: 20px;
  width: calc(100% / 4);
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: white;
  cursor: pointer;

  &:hover {
    background-color: #A0DAFB;
  }
`;

const ProjectOwner = styled.div`
  font-weight: bold;
  position: absolute;
`;

const ProjectLikes = styled.div`
  border: 1px solid #ddd;
  border-radius: 15px;
  font-weight: bold;
  width: calc(100% / 4);
  right: 10%;
  position: absolute;
`;

const ProjectTitle = styled.div`
  font-size: 20px;
  margin: 30px 0;
  font-weight: bold;
`;

const ProjectInfo = styled.div`
  font-size: 14px;
  color: #777;
`;

const Tags = styled.div`
  display: flex;
  margin-bottom: 5px;
  align-items: space-between;
`;

const Tag = styled.div`
  margin-bottom: 5px;
  margin-left: 5px;
  border: 1px solid #ddd;
  border-radius: 15px;
  padding: 5px;
  width: calc(100% / 4);
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: white;
  border-color: rgba(160, 218, 251);
  color: #0A8ED9;
`;

const Details = styled.div``;


export default Section1;
